  CONSTRAINT `profiles_ibfk_4` FOREIGN KEY (`languages_id`) REFERENCES `languages` (`id`),
  CONSTRAINT `profiles_ibfk_5` FOREIGN KEY (`organizations_id`) REFERENCES `organizations` (`id`),
  CONSTRAINT `profiles_ibfk_6` FOREIGN KEY (`listing_id`) REFERENCES `listing` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Профили';
